import React, { Component } from 'react';
import './App.css';
import './components/MapContainer'
import Landing from './components/landingpage'
import {Layout, Header, Navigation, Drawer, Content } from 'react-mdl';
import { MapContainer } from './components/MapContainer';

const mapStyles = {
    width: '100%',
    height: '100%'
  };

class App extends Component {
    state={
        showingInfoWindow:false, //hids or shows the info window
        activeMarker:{},//show active marker upon click
        selectedPlace:{} //show the infowindow to the selected place upon a marker
      };

  render() {
    return (

<div className="demo-big-content">
<Layout>
    <Header className ="header-color" title="Road Trip Advisor" scroll>
        <Navigation>
            <a href="/">Home</a>
            <a href="/">Plan a trip</a>
            <a href="/">Sign Up</a>
            <a href="/">Sign In</a>
            <a href="/">Current Location</a>
        </Navigation>
    </Header>
    <Drawer title="Menu">
        <Navigation>
        <a href="/">Home</a>
        <a href="/">Plan a trip</a>
        <a href="/">Sign Up</a>
        <a href="/">Sign In</a>
        <a href="/">Current Location</a>
        </Navigation>
    </Drawer>
    <Content>
        <div className="page-content">
          <Landing/>
          <MapContainer>

          </MapContainer>
        </div>

    </Content>
</Layout>
</div>
    );
  }
}
export default App
